import './VideoCard.scss';

const VideoCard = ({video}) => {
  console.log(video.image);

  axios
  .get(process.env.REACT_APP_API_URL + "/image/image0.jpeg")
  .then((response) => {
    console.log(response)
  })

  return (
      <article className="video-card" >
        <div className='video-card__image-container'>
          <img className="video-card__image" src="server/public/images/image0.jpeg" alt={video.title}></img>
        </div>
        <div className="video-card__info-container">
          <h3 className="video-card__title">{video.title}</h3>
          <p className="video-card__channel">{video.channel}</p>
        </div>
      </article>
  );
};

export default VideoCard;
